import React from 'react'
import {FaBars, FaTimes} from "react-icons/fa"

const NavBar = () => {

  const [nav,setNav] = Usestate(false)

  const links = [
    {
      id: 1,
      link: "home"
    },
    {
      id: 2,
      link: "about"
    },
    {
      id: 3,
      link: "portfolio"
    },
    {
      id: 4,
      link: "experience"
    },
    {
      id: 5,
      link: "contact"
    },
  ]
  return (
    <div className='flex justify-between items-center w-full h-20 text-white fixed bg-black px-4'>
      <div>
        <h1 className='text-2xl'>MyPortfolio</h1>
      </div>
      <ul className='hidden md:flex'>
        {links.map(({ id, link}) => (
        <li key={id} className='px-4 cursor-pointer capitalize font-medium text-white hover:scale-105 duration-200'>
        {link}
        </li>
        ))} 

      </ul>
      <div onClick={() => setNav=!nav} className='cursor-pointer pr-4 z-10 text-white'>
        <FaBars size={30}/>
        {nav ? <FaTimes size={30}/> : <FaBars size={30}/>}
      </div>
    </div>
  )
}

export default NavBar
